import React, { Component } from "react";

class Login extends Component {
  render() {
    const style = { textAlign: "center" };
    const redirect = () => {
      axios.get('localhost:5000/auth/signup')
    }
    return (
      <div className="login">
        <h1 style={style}>Sign-up form</h1>
        <button onClick={redirect}>Redirect to login</button>
      </div>
    );
  }
}

export default Login;
